import Swal from 'sweetalert2';
let ChefViewComponent = class ChefViewComponent {
    constructor(authService) {
        this.authService = authService;
        this.allOrders = [];
        this.allStatusOrders = [];
    }
    ngOnInit() {
        this.getOrdersOnTime(),
            this.statusPipe = '';
    }
    getOrdersOnTime() {
        this.authService.getOrders().subscribe({
            next: response => {
                this.allOrders = response;
                this.allStatusOrders = this.allOrders;
                console.log(this.allStatusOrders);
            },
            error: error => {
                console.error('There was an error!', error);
            }
        });
    }
    changeStatus(e) {
        const idOrder = e.target.id;
        const status = e.target.value;
        let statusOnTime = '';
        switch (status) {
            case 'pending':
                statusOnTime = 'delivering';
                break;
            default:
                Swal.fire({
                    icon: 'error',
                    title: 'Oops...',
                    text: 'You do not have permission to make this status change!',
